@app.route('/history/download/<lat>/<lon>', methods=['GET', 'POST'])
def getData(lat,lon):
    value=history_city(lat, lon)
    print(value)
    cur_data = pd.DataFrame(value)
    # writing to Excel
    datatoexcel = pd.ExcelWriter('output3.xlsx')

    # write DataFrame to excel
    cur_data.to_excel(datatoexcel)

    # save the excel
    datatoexcel.save()
    print('DataFrame is written to Excel File successfully.')
    return jsonify(value)
